    return (
        <div className="container">
          <StyledModal>
            Hello World!
          </StyledModal>
        </div>
    );
}

export default Modal;

const StyledModal = styled.div`
  position:fixed;
  top:50%;
  left:50%;
  transform: translate(-50%, -50%);
  background: #FFF;
  padding: 50px;
  z-index:1000;
`;
